import React from 'react';
import { View, StyleSheet, Text } from 'react-native';

export default function SizeButton() {
    return (
        <View style={styles.container}>
            <Text>
                39
            </Text>
        </View>
    );
}

const styles = StyleSheet.create({
    container:{
        width:150,
        height:50,
        justifyContent: 'center',
        alignItems: 'center',
        borderRadius: 4,
        borderColor: '#e6e6e6',
        borderWidth: 3,
        marginHorizontal: 10,
    }
})
